import React from "react";
import Question from "../Questions.jpg";


const HelpIcon = () => {
  return (
    <div class="dropdown">
      <button class="dropbtn">Additional Info</button>
      <div class="dropdown-content">
        <a href="#"><i class='fas fa-phone-alt'></i>Phone: 1 (800) 827-5722</a>
        <a href="#">TTY/TTD: 1 (800) 877-8339</a>
        <a href="#">Hours: 8 a.m to 8 p.m. (ET)</a>
        <a href="https://www.sba.gov/document/support-faq-regarding-covid-19-eidl">Frequently Asked Questions</a>
      </div>
    </div>
  );






